import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

console.log('index.js is running');

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

console.log('React app has been rendered');
